@StephenLU0422 What do you think?

I have similar issue. after deploy front with nginx. can't login with admin/dolphinscheduler123. and the log is 
```
[INFO] 2020-07-17 11:40:31.689 org.apache.dolphinscheduler.api.security.PasswordAuthenticator:[70] - session info is null
[INFO] 2020-07-17 11:40:31.690 org.apache.dolphinscheduler.api.interceptor.LoginHandlerInterceptor:[67] - user does not exist
```

following is the nginx.conf
```
server {
        listen       8888;
        server_name  localhost;
        #charset koi8-r;
        #access_log /opt/dolphinscheduler/nginx/logs/host.access.log  main;
        
        location / {
            root   /opt/dolphinscheduler/dist;
            index  index.html index.html;
        }

        location /dolphinscheduler {
            proxy_pass http://127.0.0.1:8080;
            proxy_set_header        Host $host;
            proxy_set_header X-Real-IP $remote_addr;
            proxy_set_header x_real_ipP $remote_addr;
            proxy_set_header remote_addr $remote_addr;
            proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;
            proxy_http_version 1.1;
            proxy_connect_timeout 4s;
            proxy_read_timeout 30s;
            proxy_send_timeout 12s;
            proxy_set_header Upgrade $http_upgrade;
            proxy_set_header Connection "upgrade";
        }
        #error_page  404              /404.html;
        # redirect server error pages to the static page /50x.html
        #
        error_page   500 502 503 504  /50x.html;
        location = /50x.html {
            root   /usr/share/nginx/html;
        }
    }
```

I found the reason, because the front-end version of 1.3.1 has adjusted the path, basically all the jumps (index.html or the js it calls) have increased the path `/dolphinscheduler/ui`

following is my nginx.conf,Hope to help friends who encounter the same problem.

```
location / {
        return 301 /dolphinscheduler/ui/;
    }
    location /dolphinscheduler/ui/ {
        alias  /opt/DolphinScheduler/dolphinScheduler-ui/;      # ui path
        index  index.html;
    }
    location /dolphinscheduler{
        proxy_pass http://127.0.0.1:12345;            # api port
        proxy_set_header Host $host;
        proxy_set_header X-Real-IP $remote_addr;
        proxy_set_header x_real_ipP $remote_addr;
        proxy_set_header remote_addr $remote_addr;
        proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;
        proxy_http_version 1.1;
        proxy_connect_timeout 300s;
        proxy_read_timeout 300s;
        proxy_send_timeout 300s;
        proxy_set_header Upgrade $http_upgrade;
        proxy_set_header Connection "upgrade";
    }
```

Yes,it would be better.i will fix it&nbsp; later today



